Photo by @FransLanting Every iceberg tells a story. Each one is a snapshot of water frozen in time. I photographed this blue diamond along the Antarctic Peninsula in early summer knowing it would be gone in a few months. Ninety percent of all ice on Earth is contained by Antarctica, and as our planet warms, ice shelves and glaciers dislodge an ever-larger portion of it each year into the Southern Ocean, where most icebergs melt away in a single season—adding to sea level rise. That’s how the life cycle of ice far away affects everyone living along a sea coast anywhere. 
A global #ClimateStrike will take place tomorrow, Friday, September 20, in advance of the UN Climate Action Summit, demanding action to address the climate crisis we are facing. The September 20 strike will kick off a week of actions capped by another strike on September 27. We urge you to take a stand with us. Together, let’s show our politicians we are serious about the fight against climate change. Join us, @FransLanting and @ChristineEckstrom, in this effort, and check the link in my bio to find out about events in your community and how you can join the strike.

